import React, { useState } from 'react';
import './EmailAuthForm.css';

const EmailAuthForm = () => {
  const [currentStep, setCurrentStep] = useState('email');
  const [email, setEmail] = useState('lb2005lba@gmail.com');
  const [password, setPassword] = useState('');
  const [isFocused, setIsFocused] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [showPassword, setShowPassword] = useState(false);

  const handleEmailSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);

    try {
      await new Promise(resolve => setTimeout(resolve, 1000));
      setCurrentStep('password');
    } catch (error) {
      console.error('Ошибка:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const handlePasswordSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);

    try {
      await new Promise(resolve => setTimeout(resolve, 1000));
      // Обработка успешной аутентификации
      console.log('Успешный вход:', { email, password });
    } catch (error) {
      console.error('Ошибка:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const togglePasswordVisibility = () => setShowPassword(!showPassword);
  const handleFocus = () => setIsFocused(true);
  const handleBlur = () => setIsFocused(false);

  return (
    <div className="auth-container">
      <div className="auth-card">
        {currentStep === 'email' ? (
          <>
            <div className="auth-header">
              <h1 className="auth-title">Введите адрес электронной почты</h1>
              <p className="auth-subtitle">Чтобы войти или зарегистрироваться</p>
            </div>

            <form onSubmit={handleEmailSubmit} className="auth-form">
              <div className="input-group">
                <div className={`input-wrapper ${isFocused ? 'input-focused' : ''}`}>
                  <input
                    type="email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    onFocus={handleFocus}
                    onBlur={handleBlur}
                    className="email-input"
                    placeholder="Введите ваш email"
                    required
                    disabled={isLoading}
                  />
                </div>
                <div className="input-underline"></div>
              </div>

              <button 
                type="submit" 
                className={`submit-button ${isLoading ? 'loading' : ''}`}
                disabled={isLoading}
              >
                {isLoading ? 'Загрузка...' : 'Продолжить'}
              </button>
            </form>
          </>
        ) : (
          <>
            <div className="auth-header">
              <h1 className="auth-title">Введите пароль</h1>
              <p className="auth-subtitle">Для входа в аккаунт {email}</p>
            </div>

            <form onSubmit={handlePasswordSubmit} className="auth-form">
              <div className="input-group">
                <div className={`input-wrapper ${isFocused ? 'input-focused' : ''}`}>
                  <input
                    type={showPassword ? "text" : "password"}
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    onFocus={handleFocus}
                    onBlur={handleBlur}
                    className="email-input"
                    placeholder="Введите ваш пароль"
                    required
                    disabled={isLoading}
                  />
                  <button
                    type="button"
                    className="password-toggle"
                    onClick={togglePasswordVisibility}
                  >
                    {showPassword ? "Скрыть" : "Показать"}
                  </button>
                </div>
                <div className="input-underline"></div>
              </div>

              <button 
                type="submit" 
                className={`submit-button ${isLoading ? 'loading' : ''}`}
                disabled={isLoading || !password}
              >
                {isLoading ? 'Загрузка...' : 'Войти'}
              </button>

              <button 
                type="button" 
                className="back-button"
                onClick={() => setCurrentStep('email')}
                disabled={isLoading}
              >
                Назад
              </button>
            </form>
          </>
        )}
      </div>
    </div>
  );
};

export default AuthForm;
